import React from 'react';
import Content from './Conent';
import Input from "./Input";
import Label from "./Label";

const Text = ({label,type,name}) => (
    <Label>
        <Content>{label}</Content>
       
      <Input/>
    </Label>
);

const Field={
    Text,
};
export default Field;
